plt.clf()

def load_data(fn, proc_func):
    if not os.path.isfile(fn):
        return np.array([0.0])

    out = []
    with open(fn, 'r') as fp:
        for line in fp:
            if line.startswith('#'):
                continue
            n = line.strip().split(',')
            n = list(map(float, n))
            n = proc_func(n)
            out.append(n)
    return np.array(out)

def advantage(a, b):
    out = 0.0
    l = min(len(a), len(b))
    for i in range(l):
        out += a[i] - b[i]
    return out

def run(start, end, flag):
    def work(fn, label, color='black', line_style='-', ax=plt, proc_func=np.mean, marker='', markevery=1):
        fed = load_data(fn, proc_func)
        fed = fed[start:end]
        h, = ax.plot(range(len(fed)), fed, color=color, linestyle=line_style, marker=marker, markersize=10)
        return h, label, fed

    def works(fns, label, color='black', line_style='-', ax=plt, proc_func=np.mean, marker='', tagged=False, markevery=1, use_sns=True, errorbar='ci'):
        datum = []
        for fn in fns:
            data = load_data(fn, proc_func)
            datum.append(data)
            # print(fn, ': ', np.var(data[20:]))
        l = np.min([len(d) for d in datum])
        ll = np.max([len(d) for d in datum])
        # print(l)
        if tagged:
            lens = set([len(d) for d in datum] + [0])
            lens = sorted(lens)
            out = np.zeros(shape=(np.max(lens),))
            for i in range(len(lens) - 1):
                out[lens[i]:lens[i + 1]] = np.mean([d[lens[i]:lens[i + 1]] for d in datum if len(d) >= lens[i + 1]], axis=0, keepdims=True)
                # out[lens[i]:lens[i + 1]] = o if lens[i + 1] - lens[i] > 1 else o[:, np.newaxis]
            datum = out[start:end]
        elif use_sns:
            xs = []
            ys = []
            sids = []
            for sid in range(len(datum)):
                for idx, v in enumerate(datum[sid]):
                    xs.append(idx)
                    ys.append(v)
                    sids.append(sid)
            df = pd.DataFrame(data={'xs': xs, 'ys': ys, 'sids': sids})
            h = sns.lineplot(data=df, x='xs', y='ys', color=color, linestyle=line_style, marker=marker, markersize=10, markevery=markevery, linewidth=1.0, ax=ax, errorbar=errorbar)
            return h, label, datum
        else:
            datum = [d[:l] for d in datum]
            datum = np.mean(datum, axis=0)
            datum = datum[start:end]
        h, = ax.plot(range(len(datum)), datum, color=color, linestyle=line_style, marker=marker, markersize=10, markevery=markevery, linewidth=1.0)
        return h, label, datum

